import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import './Nagation.css';


function App() {
  return (
    <div className="App">
    <h1> hello world</h1>
    {/* <Header></Header> */}
    <Router>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/administator">Administator</Link>
        <Link to="/volunteer">Volunteers</Link>
        <Link to="/student">Students</Link>
      </nav>
    </Router>

    </div>
  );
}

export default App;
